th>Old Value</th><th>New Value</th></thead><tbody><tr><td>content</td><td><div style=\"color: rgb(34, 34, 34); font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: small;\"><p align=\"left\"><b><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(204, 0, 0);\">PENTING. Bila belum menerima informasi tagihan Telkom Anda 7 (tujuh) hari sebelum tanggal jatuh tempo, harap hubungi CallCenter 147.</span></b><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(34, 68, 102);\"></span></p><p align=\"left\">Yth Bapak/Ibu&nbsp;<br></p><p align=\"left\"><br></p><p align=\"justify\">Kami ucapkan terima kasih atas kepercayaan dan kesediaan Bapak/Ibu untuk berlangganan layanan IndiHome Telkom yang merupakan layanan Triple Play (terdiri dari Telepon, Internet dan IPTV).</p><p align=\"justify\">Melalui email ini, kami sampaikan informasi tagihan layanan IndiHome Bapak/Ibu Bulan Februari 2019. Untuk kemudahan pembayarannya Telkom menyediakan beberapa moda pembayaran melalui kerjasama dengan pihak Perbankan seperti moda pembayaran Autodebet (autodebet dari rekening tabungan atau Autodebet Kartu Kredit), Mobile banking (Internet banking, SMS banking dan Phone banking) maupun ATM.</p><p>Untuk pembayaran tagihan dengan Kartu Kredit dapat dilakukan melalui aplikasi myIndiHome. Silahkan unduh aplikasi myIndiHome di Android&nbsp;<a href=\"https://goo.gl/H7xzYk\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://goo.gl/H7xzYk&amp;source=gmail&amp;ust=1550838988922000&amp;usg=AFQjCNFZTHatSgEtg5hJHSOcVuwu3KoKYg\" style=\"color: rgb(17, 85, 204);\">https://goo.gl/H7xzYk</a>&nbsp;- di IOS&nbsp;<a href=\"https://goo.gl/va3a1E\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://goo.gl/va3a1E&amp;source=gmail&amp;ust=1550838988922000&amp;usg=AFQjCNGGPIQk-IRphCRCyeealSqT3gG5Ew\" style=\"color: rgb(17, 85, 204);\">https://goo.gl/va3a1E</a>.</p><p>Silakan gunakan password e-Statement Anda untuk membukanya.&nbsp;<br><br>Password standar e-Statement adalah</p><b><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(204, 0, 0);\">123456</span></b><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(34, 68, 102);\">&nbsp;<br><br></span><b><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(204, 0, 0);\">Untuk membuka lampiran e-Statement, Anda membutuhkan Adobe Reader versi 7 atau versi yang lebih baru</span></b><span style=\"font-size: 9pt; font-family: Arial, sans-serif; color: rgb(34, 68, 102);\">.&nbsp;<br><a href=\"http://get.adobe.com/reader/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=http://get.adobe.com/reader/&amp;source=gmail&amp;ust=1550838988922000&amp;usg=AFQjCNG9GMnvuBJ2ewz3M_fn5uWjG-E1eQ\" style=\"color: rgb(17, 85, 204);\"><img src=\"https://mail.google.com/mail/u/0?ui=2&amp;ik=578b12841d&amp;attid=0.1&amp;permmsgid=msg-f:1624731186024836831&amp;th=168c3467ce826edf&amp;view=fimg&amp;sz=s0-l75-ft&amp;attbid=ANGjdJ-7vB5u0R8TqKAwMT-QfxhbxaKrRSFWC3_vGPK4zL66dVAiRRjof1u3xciDGFMmBglGtPa5gNOtRXOJOdt0Bpik0bVWiv_YzI6E2qFDpDZWlHs_Jrc7gP8gorY&amp;disp=emb\" alt=\"Get ADOBE Reader\" border=\"0\" height=\"33\" width=\"112\" data-image-whitelisted=\"\" class=\"CToWUd\"></a><br><br>Beberapa hal penting yang perlu Anda perhatikan untuk keamanan Informasi Billing Statement Anda :</span><ul type=\"disc\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(34, 68, 102);\"><p align=\"left\" style=\"margin-top: 2px; margin-bottom: 2px;\"><span style=\"font-family: Arial, sans-serif; font-size: 9pt;\">Apabila pelanggan menerima telepon atau sms atau surat terkait program berhadiah dari Telkom, untuk menghindari kemungkinan penipuan yang meng atas namakan Telkom, dimohon kesediaannya melakukan konfirmasi ke Contact Center Telkom - 147 (pulsa lokal)</span><span style=\"font-size: 9pt; font-family: Arial, sans-serif;\">.</span></p></li><li class=\"MsoNorma